import { Nav, Button, Container, Navbar } from "react-bootstrap";

const Banner = () => {
  return (
    <>
      <div className="banner">
        <div
          className="banner-overlay"></div>
        <div className="banner-content p-5">
          <h1 className="title">JEAN CARLOS ZAMUDIO LABÁN</h1>
          <p className="profession">Ingeniero de Software
          Mi nombre es Jean Carlos Zamudio Labán. Soy un aficionado por la tecnología y siempre estoy dispuesto a aprender nuevas
        herramientas.</p>
        <Button variant="info"></Button>
        </div>
      </div>
    </>
  );
};

export default Banner;
